<?php
if(!isset($_GET['pos']) || !isset($_GET['type'])){
	exit;
}
$pos=$_GET['pos'];
$type=$_GET['type'];
if(file_exists("Runtime/Data/imgdata/$type/$pos.php")){
	$obj=include("Runtime/Data/imgdata/$type/$pos.php");	
	$imgdata=$obj['imgdata'];
	header('Content-type: image/jpeg');
	echo base64_decode(substr($imgdata,23));
}else{
	header('Content-type: image/jpeg');
	echo base64_decode('');
}
